import React from 'react';
import classes from "./Chip.module.css";
import {useSelector} from "react-redux";

const Chip = () => {
    const cart = useSelector(state => state.inCart.products);
    return (
        <div className={classes.chip}>
            {cart.length}
        </div>
    );
};

export default Chip;
